import React, { useEffect, useState } from "react";

const Users = () => {
  let [user, setUser] = useState([]);
  useEffect(() => {
    fetch("http://localhost:4000/users")
      .then((data) => data.json())
      .then((elem) => setUser(elem));
  });

  return (
    <div>
      <table border={1}>
        <tr>
          <th>id</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Email</th>
          <th>State</th>
          <th>Number</th>
          <th>DOB</th>
        </tr>
        {
          user.map(elem)
        }
      </table>
    </div>
  );
};

export default Users;
